import { Divider } from '@mui/material'
import React from 'react'

const Post = (props) => {
    return (
        <div className='post'>
            <div className='img'>
                {props.image && (
                    <img className='image' />
                )}

                {!props.image && (
                    <div className='rectangle green regular-font'>
                        No Image Provided
                    </div>
                )}
            </div>
            <div className='post-content'>
                <h2 className='white bold-font'>Report <span className='green bold-font'>Title</span></h2>
            </div>
            <div>
                <h4 className='thin-font'>08/24/2023 <span className='green'><h3>10:16</h3></span></h4>
            </div>
            <Divider />
        </div>
    )
}

export default Post
